import "./form.css"

const FormSearch = ({ onSubmit, onChange }) => {
  return (
    <div >
      <form className="ss" onSubmit={onSubmit}>
        <input type="text" onChange={onChange} />
        <input type="submit" value="Buscar" />
      </form>
    </div>
  );
};

export default FormSearch;
